import React, { Component } from "react";

class SaveList extends Component {
    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col'>
                        <ul>
                            <li key={1}>
                                <p>저장 제목</p>
                                <input type='button' value='View'></input>
                                <input type='button' value='Delete'></input>
                            </li>
                            <li key={2}>
                                <p>저장 제목</p>
                                <input type='button' value='View'></input>
                                <input type='button' value='Delete'></input>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default SaveList;
